# https://leetcode.com/problems/maximal-rectangle/
from itertools import accumulate, product


def max_rect(mat):
    num_rows = len(mat)
    num_cols = len(mat[0])
    acc = [[[0, 0] for _ in range(num_cols)] for _ in range(num_rows)]
    for c in range(num_cols):
        run = 0
        for r in range(num_rows - 1, -1, -1):
            cur = mat[r][c]
            run = run + cur if cur else 0
            acc[r][c][0] = run

    for r in range(num_rows):
        run = 0
        for c in range(num_cols - 1, -1, -1):
            cur = mat[r][c]
            run = run + cur if cur else 0
            acc[r][c][1] = run

    def _get_max_rect(acc, r, c):
        max_r, max_c = acc[r][c]
        max_possible = 0
        for cur_r in range(r + 1, r + max_r):
            for cur_c in range(c + 1, c + max_c):
                pass

    return acc


def to_summed_area_table(mat):
    acc = mat
    acc = [list(accumulate(row)) for row in acc]
    acc = list(zip(*acc))
    acc = [list(accumulate(row)) for row in acc]
    acc = list(zip(*acc))

    res = [[0] * (len(acc[0]) + 1)]
    res.extend([0] + list(row) for row in acc)
    return res


def _calc_sat_diff(acc, cur_r, cur_c, o_r, o_c):
    return acc[o_r][o_c] - acc[cur_r - 1][o_c] - acc[o_r][cur_c - 1] + acc[cur_r - 1][cur_c - 1]


def calc_max(mat):
    mat = _to_ints(mat)
    acc = to_summed_area_table(mat)
    num_rows = len(acc)
    num_cols = len(acc[0])
    cur_max = 0

    for cur_r, cur_c in product(range(1, num_rows), range(1, num_cols)):
        if not mat[cur_r - 1][cur_c - 1]:
            continue
        if (num_rows - cur_r + 1) * (num_cols - cur_c + 1) <= cur_max:
            continue
        for o_r, o_c in product(range(num_rows - 1, cur_r - 1, -1), range(num_cols - 1, cur_c - 1, -1)):
            cur_sum = _calc_sat_diff(acc, cur_r, cur_c, o_r, o_c)
            # print(cur_sum)
            if cur_sum == (o_r - cur_r + 1) * (o_c - cur_c + 1):
                cur_max = max(cur_max, cur_sum)

    return cur_max

def _to_ints(mat):
    return [[int(c) for c in row] for row in mat]


